function init_select(min, max, label) {
    html = '';
    for (var i = min; i <= max; i++) {
        html = html + '<option data-subtext="' + label + '" value="' + i + '" ' + (i === min ? 'selected' : '') + '>' + i + '</option>';
    }
    return html;
}

