function saveAirlines(a) {
    for (var i = 0; i < a.length; i++) {
        a[i] = a[i].toLowerCase();
        if ($('#' + a[i]).is(':checked')) {
            setItem((a[i]), true);
        } else {
            setItem((a[i]), false);
        }
    }
}

function restoreAirlines(a) {
    for (var i = 0; i < a.length; i++) {
        a[i] = a[i].toLowerCase();
        if (getItem(a[i]) === true) {
            $('#' + a[i]).attr('checked', true);
            $('#' + a[i]).closest('.btn.btn-light').addClass('active');
        }
    }
}

// ========================================
// Sort Array by occurrence of its elements
// ========================================
function sort_array_occurrence(arr) {
    if (arr !== null) {
        var map = arr.reduce(function(obj, val) {
            obj[val] = (obj[val] || 0) + 1;
            return obj;
        }, {});
        var sorted = Object.keys(map).sort(function(a, b) {
            return map[b] - map[a];
        });
        return sorted;
    } else {
        return [];
    }
}

// ====================================
// Set get remove localStorage
// ====================================
function setItem(key, val) {
    if (Array.isArray(val) || (Object.prototype.toString.call(val) === '[object Object]')) {
        window.localStorage.setItem(key, JSON.stringify(val));
    } else {
        window.localStorage.setItem(key, val);
    }
}

function getItem(key) {
    var x = window.localStorage.getItem(key);
    try {
        return JSON.parse(x);
    } catch (e) {
        if (isNaN(x) || (x === ''))
            return x
        else
            return parseInt(x);
    }
}

function removeItem(key) {
    if (Array.isArray(key)) {
        key.forEach(function(element, index) {
            window.localStorage.removeItem(element);
        });
    } else {
        window.localStorage.removeItem(key);
    }
}

