function restoreSearch(input) {
    var inputs = input.split(' ');
    $('#origin').selectpicker('val', inputs[0].substring(0, 3)).change();
    $('#destination').selectpicker('val', inputs[0].substring(3, 6));

    caleran.config.startDate = moment(inputs[1].substring(0, 8), 'DDMMYYYY');
    caleran.config.endDate = moment(inputs[1].substring(0, 8), 'DDMMYYYY');


    if (inputs[1].length === 8) {
        $('#trip-type').text('Một chiều');
        caleran.config.singleDate = true;
        setItem('oneway', true);

    } else {
        $('#trip-type').text('Khứ hồi');
        caleran.config.singleDate = false;
        setItem('oneway', false);
        caleran.config.endDate = moment(inputs[1].substring(8, 16), 'DDMMYYYY');
    }

    caleran.setDisplayDate();
    $('#adults').selectpicker('val', parseInt(inputs[2].substring(0, 2)));
    $('#children').selectpicker('val', parseInt(inputs[2].substring(2, 4)).toString());
    $('#infants').selectpicker('val', parseInt(inputs[2].substring(4, 6)));

    $('#promo-code').val(inputs[3] || '');
}

function saveSearch() {

    var output = $('#origin').val() + $('#destination').val() + ' ' + caleran.config.startDate.format('DDMMYYYY') + ($('#trip-type').text() === 'Khứ hồi' ? caleran.config.endDate.format('DDMMYYYY') : '') +
        ' ' + ($('#adults').val().length === 1 ? '0' + $('#adults').val().length : $('#adults').val().length) +
        '0' + $('#children').val() + '0' + $('#infants').val() +
        ($('#promo-code').val() !== '' ? ' ' + $('#promo-code').val() : '');

    var preSearch = getItem('preSearch') || [];
    var tempSearch = preSearch;
    var indexSearch = preSearch.indexOf(output);

    var check_upload = true;

    if (indexSearch === -1) {
        preSearch.push(output);
        if (preSearch.length >= 101) {
            preSearch.shift();
        }

    } else {
        if (indexSearch === preSearch.length - 1) {
            check_upload = false;
        }
        preSearch.splice(indexSearch, 1);
        preSearch.push(output);
    }

    setItem('preSearch', preSearch);

}

